import CustomButton from "../CustomButton"
const options = [
  {value:'google', label:'Google'}
]

const iconBtn = [
  {path:'bell.svg',},
  {path:'settings.svg',},
  {path:'person.svg',}
]
const NavBar = () => {

  const IconButton  = () =>{
   return( <CustomButton className="text-[14px] font-medium w-[48px] flex justify-center items-center">
      <img src={'images/bell.svg'} alt='logo' />
      </CustomButton>
   )
  }
    return(
      <nav className="h-[84px] bg-[#FFFFFF] text-white flex items-center justify-between px-6 fixed w-[81%] left-[101px] top-0 z-50">
       <div className="flex items-center gap-2">
        <p className="text-black_500 text-[16px] font-bold ">Review</p>
      <select className="border-2 border-[#4D4CAC] text-black_500 text-[16px] !min-w-[184.75px] h-[40px] rounded-[8px]">

        {
          (options ||[]).map((option,index)=>{
            return(
              <option key={index} value={option.value}>{option.label}</option>
            )
          })
        }

      </select>
      <CustomButton className="bg-[#40E1FA1A] text-[#2CA01D] text-[12px] font-bold w-[140px]">Quickbookâ€™s Data</CustomButton>
      </div>
      <div className="flex items-center gap-1">
      <CustomButton className="text-[14px] font-medium w-[48px] flex justify-center items-center"><img src={'images/search.svg'} alt='logo' /></CustomButton>

      <CustomButton className="text-[14px] font-medium w-[120px]">Export to Excel</CustomButton>
      <CustomButton className="text-[14px] font-medium w-[120px]">Add Dcoument</CustomButton>
      <CustomButton className="text-[14px] font-medium w-[120px]">Connect</CustomButton>
      <CustomButton className="text-[14px] font-medium w-[48px] flex justify-center items-center"><img src={'images/settings.svg'} alt='logo' /></CustomButton>
      <CustomButton className="text-[14px] font-medium w-[48px] flex justify-center items-center"><img src={'images/person.svg'} alt='logo' /></CustomButton>

      </div>
    </nav>
    )
}

export default NavBar
